protected ExtensionalWebSocketPlugin(String pattern, List<WebSocketCodec> webSocketCodecs, List<WebSocketParser<?>> webSocketParsers)
{
    if (pattern == null || pattern.isEmpty()) {
        throw new IllegalArgumentException("Pattern can't be empty");
    }
    this.pattern = pattern;
    if (webSocketCodecs == null) {
        this.webSocketCodecs = Collections.emptyList();
    } else {
        this.webSocketCodecs = webSocketCodecs.stream().sorted(Comparator.comparingInt(Order::getOrder)).collect(Collectors.toList());
    }
    if (webSocketParsers == null) {
        this.webSocketParsers = Collections.emptyList();
    } else {
        this.webSocketParsers = webSocketParsers.stream().sorted(Comparator.comparingInt(Order::getOrder)).collect(Collectors.toList());
    }
}

